import React from 'react'
import mapboxgl from 'mapbox-gl';

mapboxgl.accessToken = 'pk.eyJ1IjoiYXF1YWltcGFjdCIsImEiOiJja2R0d2N3emswdzlwMnptcGliNTk4ZHNkIn0.jPYEzZD-aErgL25Zx9N_Kg';

class maps extends React.Component{

    constructor(props){
        super(props)
        this.mapContainer = React.createRef();
    }

    componentDidMount(){
        const map = new mapboxgl.Map({
            container: this.mapContainer,
            style: 'mapbox://styles/mapbox/streets-v11',
            center: [103.95143, 1.35658],
            zoom: 2
        });
    }

    // var element = document.getElementById("mapGLSpace")
    render(){
        return(
            <div>
                <div ref={this.mapContainer}/>
            </div>
        )
    }
}

export default maps
